        await Http.PostJsonAsync("api/SalesOrderHeadersIndex", addSOHeader);

        var addSODetails = new SalesOrderDetails { Header_ID = Int32.Parse(solist.Order_Number), Material_N = solist.Material_N, Article_Description = solist.Article_Description, Pack_Size = solist.Pack_Size, Cases = solist.Cases, Pieces = solist.Pieces, Free_Cases = solist.Free_Cases, Free_Piece = solist.Free_Piece, Delivery_Qty_CS = solist.Delivery_Qty_CS, Delivery_Qty_PC = solist.Delivery_Qty_PC, Sales_Value = solist.Sales_Value, VAT_Value = solist.VAT_Value, Net_Sales = solist.Net_Sales, Item_Number = solist.Item_Number, Cases_Pieces = solist.Cases_Pieces, Free_CS_PS = solist.Free_CS_PS };
